var $bm_rt;
var X, F, L, T, Cursor, Cursor, Cursor, Fl, Fl;
X = text.sourceText;
F = Math.round($bm_mod($bm_mul(time, thisComp.layer('Adjustment Layer 1').effect('Blinking speed')('Slider')), 1));
L = X.length;
T = $bm_sub($bm_mul(time, thisComp.layer('Adjustment Layer 1').effect('Speed')('Slider')), $bm_mul(thisComp.layer('Adjustment Layer 1').effect('Start point')('Slider'), thisComp.layer('Adjustment Layer 1').effect('Speed')('Slider')));
Cursor = ' ';
if (F == 1 | T > 0)
    Cursor = '|';
if (T >= L)
    Cursor = ' ';
if (T > 0)
    $bm_sum(X.substr(0, T), Cursor);
else
    Cursor;
if (F == 1 | T < L & T > 0) {
    Fl = '|';
} else {
    Fl = ' ';
}
$bm_rt = $bm_sum(substr(0, T), Fl);

